const tasks = [
    {
        id: 1,
        text: 'this is a text example 1',
        day: 'Feb 5th at 2:30pm',
        reminder: true
    },
    {
        id: 2,
        text: 'this is a text example 2',
        day: 'Feb 8th at 2:30pm',
        reminder: true
    },
    {
        id: 3,
        text: 'this is a text example 3',
        day: 'Feb 7th at 2:30pm',
        reminder: true
    }
]

const Tasks = () => {
  return (
    <>
        {tasks.map((task) => (
            <h3>{task.text}</h3>
        ))}
    </>
  )
}

export default Tasks
